#else
void Moon::DrawGore(int startAngle, int endAngle, word* , bool wax)
{
  // draws a "gore" of the moon image, a strip of pixels between the two meridian angles, 0 starting from the LEFT
  // if wax, uses the given palette, otherwise black
  // SIMPLIFIED LESS DETAIL version of the one above, just trig, black and white
  lcd.setWindow(0, 0, LCD_WIDTH, LCD_HEIGHT);
  
  int left = (LCD_WIDTH - MOON_IMAGE_WIDTH)/2;
  int top = (LCD_HEIGHT - MOON_IMAGE_HEIGHT)/2;
  byte startEdges[MOON_IMAGE_WIDTH];
  byte endEdges[MOON_IMAGE_WIDTH];
  int imageDiameter = MOON_IMAGE_WIDTH;
  
  // pre-build the trig calculations so they don't happen while we're drawing, a delay before we start is better than while painting a strip
  for (int i = 0; i <=  imageDiameter/2; i++)
  {
    startEdges[i] = i + rcosx(i, startAngle);
    endEdges[i] = i + rcosx(i, endAngle);
  }
  
  for (int row = 0; row < imageDiameter; row++)
  {
    int dY = abs(row - imageDiameter/2);
    int blackCols = imageDiameter/2 - sqrt(imageDiameter*imageDiameter/4 - dY*dY);
    int colourCols = imageDiameter - 2*blackCols;
    int startEdge = startEdges[colourCols/2];
    int endEdge = endEdges[colourCols/2];
    lcd.setPosition(left + blackCols + colourCols - startEdge, top + row, startEdge - endEdge + 1, 1);
    byte colour = wax?0xFF:0x00;
    lcd.fillByte(startEdge - endEdge + 1, colour);
  }
}
